import React from "react";

const Plan = (props) => {
  const wishlistDisplay = props.wishlist.map((want) => {
    return <li>{want}</li>;
  });
  return (
    <div style = {{display: "flex"}}>
      <div className = "wishlist">
        Your wishlist
        <ul>
          {wishlistDisplay}
        </ul>
      </div>
      <div className = "plan">

      </div>
    </div>
  );
};

export default Plan;
